import React, { useState } from 'react';

const Navbar = () => {
  const [mobileMenuVisible, setMobileMenuVisible] = useState(false);

  return (
    <nav className="bg-gradient-to-r from-purple-900 via-indigo-900 to-blue-900 text-white shadow-md">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16 items-center">
          <div className="flex-shrink-0">
            <a href="#" className="text-2xl font-bold text-pink-400"> <img src="../asse" alt="" />ðŸŒ¸ Animefy</a>
          </div>

          {/* Desktop Menu */}
          <div className="hidden md:flex space-x-6 text-sm font-medium">
            <a href="#" className="hover:text-pink-300 transition duration-300">Home</a>
            <a href="#" className="hover:text-pink-300 transition duration-300">About</a>
            <a href="#" className="hover:text-pink-300 transition duration-300">Services</a>
            <a href="#" className="hover:text-pink-300 transition duration-300">Contact</a>
          </div>

          {/* Mobile Hamburger */}
          <div className="md:hidden">
            <button onClick={() => setMobileMenuVisible(!mobileMenuVisible)}>
              <svg className="h-6 w-6 text-pink-300" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2"
                      d="M4 6h16M4 12h16M4 18h16"/>
              </svg>
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Menu */}
      {mobileMenuVisible && (
        <div className="md:hidden px-4 pb-4 space-y-2 text-sm font-medium">
          <a href="#" className="block py-2 hover:text-pink-300 transition">Home</a>
          <a href="#" className="block py-2 hover:text-pink-300 transition">About</a>
          <a href="#" className="block py-2 hover:text-pink-300 transition">Services</a>
          <a href="#" className="block py-2 hover:text-pink-300 transition">Contact</a>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
